class VDOM_flowplayer(VDOM_object):

	def render(self, parent, contents=""):

		if self.visible == "1":
			vis = ""
		else:
			vis = "display:none;"

		if self.autoplay == "1":
			autoplay = "true"
		else:
			autoplay = "false"

		if self.controls == "1":
			controls = '{ url: "/4e7053c1-44b9-b9fb-69f9-5056d06b752a.swf" }'
		else:
			controls = "null"

		if self.splash == "":
			splash = ''
		else:
			splash = "<img src='/%s.res' />"%(self.splash)

		if self.movieres == "":
			movie = self.movieurl
		else:
			movie = "/%s.res"%(self.movieres)

		if self.scaling == "1":
			scaling = "scaling: 'scale',"
		else:
			scaling = "scaling: 'fit',"


		style="%s z-index: %s;position: %s;top: %spx;left: %spx;width: %spx;height: %spx; "%(vis, self.zindex, self.position, self.top, self.left, self.width, self.height)
		id = 'o_' + (self.id).replace('-', '_')

		result = """<div id="%(id)s" style="%(style)s">
<div id="play%(id)s" style="display:block;width:%(w)spx;height:%(h)spx;overflow:hidden">%(splash)s</div>
</div>
<script type='text/javascript'>
jQuery(document).ready(function($){
	flowplayer("play%(id)s", "/09b13189-818a-a76f-f53e-8779b231ba51.swf", {
		clip: { %(scaling)s
			url: "%(url)s",
			autoPlay: %(autoplay)s
		},
		plugins: { controls: %(controls)s }
	});
});
</script>
<script type='text/javascript' src='/3dc7a90b-cd13-3436-2956-b1750bf5eedc.js'></script>
%(contents)s
		"""%{
			"id":		id, 
			"style":	style, 
			"contents": contents, 
			"w":		self.width, 
			"h":		self.height,
			"autoplay": autoplay, 
			"scaling":	scaling,
			"url":		movie,
			"splash":	splash,
			"controls":	controls
		}

		return VDOM_object.render(self, parent, contents=result)

	def wysiwyg(self, parent, contents=""):
		result=""\
			"<container id=\"%(id)s\" visible=\"%(visible)s\" zindex=\"%(zindex)s\" hierarchy=\"%(hierarchy)s\" order=\"%(order)s\" top=\"%(top)s\" left=\"%(left)s\" width=\"%(width)s\" height=\"%(height)s\">"\
				"<svg>"\
					"<rect opacity=\"0.5\" x=\"0\" y=\"0\" width=\"%(width2)s\" height=\"%(height2)s\" fill=\"#EEEEEE\" stroke=\"#777777\"/>"\
				"</svg>"\
				"<text top=\"2\" left=\"5\" width=\"70\" color=\"#4E4E4E\">Flowplayer</text>"\
			"</container>"%{
				'id':			self.id, 
				'visible':		self.visible, 
				'zindex':		self.zindex, 
				'hierarchy':	self.hierarchy, 
				'order':		self.order,	
				'top':			self.top, 
				'left':			self.left, 
				'width':		self.width, 
				'height':		self.height,
				'width2':		int(self.width) - 8, 
				'height2':		int(self.height) - 8 
				}
		return VDOM_object.wysiwyg(self, parent, contents=result)
